              <div
                style={{
                  marginBottom: '1rem',
                  transition: 'transform 0.3s ease',
                }}
              >
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  width="24"
                  height="24"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  style={{
                    height: '3rem',
                    width: '3rem',
                    color: '#FB923C',
                  }}
