                onClick={() => handleModalOpen(1)}
                style={{
                  position: 'absolute',
                  bottom: '1rem',
                  right: '1rem',
                  paddingLeft: '1rem',
                  paddingRight: '1rem',
                  paddingTop: '0.5rem',
                  paddingBottom: '0.5rem',
                  backgroundColor: 'transparent',
                  color: '#FB923C',
                  border: '1px solid #FB923C',
                  borderRadius: '0.375rem',
                  transition: 'all 0.3s ease',
                }}
