                Learn More
              </button>
            </div>
          </div>

          {/* Excellence */}
          <div
            style={{
              opacity: 1,
              transform: 'none',
            }}
          >
            <div
              style={{
                padding: '1.5rem',
                backgroundColor: 'rgba(255, 255, 255, 0.5)',
                backdropFilter: 'blur(10px)',
                borderRadius: '0.5rem',
                boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
                position: 'relative',
                cursor: 'pointer',
                transition: 'all 0.3s ease-in-out',
              }}
            >
