                  position: 'absolute',
                  bottom: '1rem',
                  right: '1rem',
                  paddingLeft: '1rem',
                  paddingRight: '1rem',
                  paddingTop: '0.5rem',
                  paddingBottom: '0.5rem',
                  backgroundColor: 'transparent',
                  color: '#4B5563',
                  border: '1px solid #4B5563',
                  borderRadius: '0.375rem',
                  transition: 'all 0.3s ease',
                }}
              >
