              fontSize: '1.0rem',
              fontWeight: '600',
              border: 'none',
              borderRadius: '0.375rem',
              cursor: 'pointer',
              transition: 'all 0.3s ease',
              marginLeft:'400px',
              padding: "10px 10px",
              width: '300px', // Add this line for width
