            }}
          >
            Learn More About Our Initiatives
          </button>
        </div>

        {/* Content Window */}
        {contentWindowOpen && (
          <div
            style={{
              position: 'fixed',
              top: 0,
              left: 0,
              right: 0,
              bottom: 0,
              background: 'rgba(0, 0, 0, 0.5)',
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              zIndex: 10,
            }}
          >
            <div
              style={{
                background: '#fff',
                padding: '2rem',
                borderRadius: '0.5rem',
                width: '80%',
                maxWidth: '1000px',
              }}
            >
              <div
                style={{
                  display: 'grid',
                  gridTemplateColumns: 'repeat(2, 1fr)', // Adjusted to 2 cards per row
                  gap: '1.5rem',
