              <button
                onClick={handleContentWindowClose}
                style={{
                  marginTop: '2rem',
                  padding: '1rem 2rem',
                  backgroundColor: '#FB923C',
                  color: '#fff',
                  fontSize: '1rem',
                  border: 'none',
                  borderRadius: '0.375rem',
                  cursor: 'pointer',
                  transition: 'all 0.3s ease',
                }}
              >
                Close
              </button>
            </div>
          </div>
        )}
          {/* Modals */}
          {modalOpen && (
            <div
              style={{
                position: 'fixed',
                top: 0,
                left: 0,
                width: '100%',
                height: '100%',
                backgroundColor: 'rgba(0, 0, 0, 0.6)',
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                zIndex: 9999,
              }}
            >
              <div
                style={{
                  backgroundColor: '#fff',
                  padding: '2rem',
                  borderRadius: '0.5rem',
                  maxWidth: '600px',
                  width: '100%',
                }}
              >
                <h2
                  style={{
                    fontSize: '1.875rem',
                    fontWeight: '700',
                    color: '#1F2937',
                    textAlign: 'center',
                    marginBottom: '2rem',
                  }}
                >
                  Learn More About {['Growth', 'Excellence', 'Impact', 'Innovation'][modalOpen - 1]}
